pragma solidity ^0.4.2;

contract Leases {
	
	struct Lease {
    	address  landlord; 
    	address  tenant;
    	address  litigator;
    	string  physicalAddress;
    	string  hashId;
    	string  state;
    	bool  signature; 
    	uint key;
    	LeaseDetail leaseDetail;
    }

    struct LeaseDetail {
    	uint rentPerMonth;
    	uint depositToPay;
    	uint depositPaid;
    	uint totalRentToPay;
    	uint rentPaid;
    	uint durationInMonth;
    	uint balanceToBeWithdrawn;
    }
    
    Lease[] public leases; 
    
    uint public leasesCount;
    
    mapping (uint => address) public leaseIndexToOwner;
    mapping (address => uint) public ownershipContractCount;

    event leaseCreatedEvent (
        uint indexed index
    );

    event leaseSignedEvent (
    	uint indexed index
    );

    event depositFullEvent (
    	uint indexed index 
    );

    event rentPaidMonth (
    	uint indexed index
    );	

    event rentWithdrawn (
    	uint indexed index
    );

	constructor() public {
	}

	function createLease(
						address _tenant, 
						address _litigator, 
						string _physicalAddress, 
						string _hashId, 
						uint _rentPerMonth, 
						uint _deposit,
						uint _durationInMonth) 
		public 
		returns(bool) 
		{
			leases.push(Lease(
				msg.sender,  
				_tenant, 
				_litigator, 
				_physicalAddress, 
				_hashId, 
				"created", 
				false,
				leasesCount, 
				LeaseDetail(_rentPerMonth, 
				_deposit,
				0,
				_rentPerMonth*_durationInMonth,
				0,
				_durationInMonth,
				0)));

			leaseIndexToOwner[leasesCount] = msg.sender;
			ownershipContractCount[msg.sender]++;
			emit leaseCreatedEvent(leasesCount);
			leasesCount++;
			return true;
		}

	function signLease(uint _index) 
		public
		returns(bool)
		{
			require(msg.sender == leases[_index].tenant);
			leases[_index].signature = true;
			leases[_index].state="signed";
			emit leaseSignedEvent(leases[_index].key);
			return true;
		}

	function payDeposit(uint _index)
		public 
		payable
		returns(bool)
		{
			require(msg.sender == leases[_index].tenant);
			leases[_index].leaseDetail.depositPaid += msg.value;
			leases[_index].state = "active";
			emit depositFullEvent(leases[_index].key);
			return true;
		}

	function payRent(uint _index)
		public
		payable
		returns(bool)
		{
			require(msg.sender == leases[_index].tenant);
			leases[_index].leaseDetail.rentPaid += msg.value;
			leases[_index].leaseDetail.balanceToBeWithdrawn += msg.value;
			emit rentPaidMonth(leases[_index].key);
			if (leases[_index].leaseDetail.rentPaid >= leases[_index].leaseDetail.totalRentToPay) {
				leases[_index].state = "complete";
				leases[_index].tenant.transfer(leases[_index].leaseDetail.depositPaid);
				leases[_index].leaseDetail.depositPaid = 0;
			}
			return true;
		}

	function withdrawRent(uint _index)
		public
		returns(bool)
		{
			require(msg.sender == leases[_index].landlord);
			address(leases[_index].landlord).transfer(leases[_index].leaseDetail.balanceToBeWithdrawn);
			leases[_index].leaseDetail.balanceToBeWithdrawn = 0;
		}
 
}
